import './css/Note.css';
import delIcon from './assets/delete.png';
import editIcon from './assets/edit.png';
import Modal from './EditNoteModal';

function Note({id, text, date, modal, handleDeleteClick, handleUpdateClick}) {
    return (
        <div className="note-body">
            <button className="modalBtn" onClick={() => modal(true)}>Modal</button>
            {text} 
            <div className="note-footer"> 
                {date}
                <span>
                    <input className="del-icon" type="image" src={editIcon} alt="Submit" onClick={() => modal(true)} align="right"></input>
                    <input className="del-icon" type="image" src={delIcon} alt="Submit" onClick={() => handleDeleteClick(id)} align="right"></input>
                </span>
            </div>           
        </div>
    );
}

export default Note;
